import React from "react";
import { Tile } from "../tile/Tile";



export const TileList = (props) => {
  const { tiles, removeAppointment } = props;

  

 

  return (
    <div>
      {
        tiles.map((tile, index) => {
          const { name, ...description } = tile;
          return <Tile key={crypto.randomUUID()} name={name} description={description} onClick={(index) => removeAppointment} index={index} />
        } )
      }
      
    </div>
  );
};
